            <li><a href="/public/show/co173">Australian Antarctic Division Herbarium</a> The Australian Antarctic Division Herbarium (ADT) collection contains one of the most significant Antarctic collections of lichens and bryophytes collected from nearly half of continental Antarctica.  It also contains specimens from Subantarctic islands (in order of significance - Macquarie Island, Heard Island, Campbell Island and Auckland Islands). 
</li>
          
